import { useHomeData } from '../../hooks/useHomeData';

import HomeSpecialtySection from '../../components/home/HomeSpecialtySection';
import HomeFacilitySection from '../../components/home/HomeFacilitySection';
import HomeDoctorSection from '../../components/home/HomeDoctorSection';

const Home = () => {
  const { doctors, specialties, facilities, loading } = useHomeData();

  if (loading) return <div>Loading...</div>;

  return (
    <>
      <HomeSpecialtySection specialties={specialties} />
      <HomeFacilitySection facilities={facilities} />
      <HomeDoctorSection doctors={doctors} />
    </>
  );
};

export default Home;
